import { useMemo } from "react";
import { Text } from "react-native";

const TodayWorkout = () => {
    const todayDate = useMemo(() => new Date().toLocaleString().split(",")[0], []);

    return (
        <Text>{todayDate}</Text>
    );
}

export default TodayWorkout;
